import {
  AM_BASIC_NEW
} from '../../actions/types';

const initialState = {
  basic: []
}

export default function(state = initialState, action) {
  const { type, payload } = action;

  // console.log(payload)

  switch(type) {
    case AM_BASIC_NEW:
      state.basic = state.basic.slice();
      state.basic.push(payload)
      return state
    default:
      return state;
  }
}
